package analysis.syntaxtree;import analysis.visitors.TypeVisitor;import analysis.visitors.Visitor;public class IdentifierType implements Type {  public String className;  public IdentifierType(String as) {    className = as;  }  public void accept(Visitor v) {    v.visit(this);  }  public Type accept(TypeVisitor v) {    return v.visit(this);  }  @Override  public String toString() {    return className;  }}